// Function to create tab cloak buttons
function createTabCloakButtons() {
    const container = document.getElementById('tabCloakButtons');
    if (!container) return;

    // Clear existing buttons
    container.innerHTML = '';

    // Create button for each option
    for (const option of tabCloakOptions) {
        const button = document.createElement('button');
        button.className = 'tabCloakiconButtons';
        button.onclick = () => updateTabCloak(option);

        // Create icon
        const icon = document.createElement('img');
        icon.src = option.icon;
        icon.alt = option.name;
        icon.style.width = '16px';
        icon.style.height = '16px';
        icon.style.marginRight = '8px';

        // Create text
        const text = document.createElement('span');
        text.textContent = option.name;

        button.appendChild(icon);
        button.appendChild(text);

        // Check if this option is currently active
        const currentIcon = localStorage.getItem('tabCloakIcon');
        if (currentIcon === option.icon) {
            button.classList.add('active');
        }

        // Hover effects are handled by CSS

        container.appendChild(button);
    }
}

// Function to update tab cloak
function updateTabCloak(option) {
    // Update document title
    document.title = option.title;

    // Update favicon
    const existingFavicons = document.querySelectorAll('link[rel*="icon"]');
    for (const favicon of existingFavicons) {
        favicon.remove();
    }

    const newFavicon = document.createElement('link');
    newFavicon.rel = 'icon';
    newFavicon.href = option.icon;
    document.head.appendChild(newFavicon);

    // Save to localStorage
    localStorage.setItem('tabCloakTitle', option.title);
    localStorage.setItem('tabCloakIcon', option.icon);
    localStorage.setItem('tabCloakName', option.name); // Store the name to differentiate between similar options

    // Update active state of buttons
    const buttons = document.querySelectorAll('.tabCloakiconButtons');
    for (const button of buttons) {
        button.classList.remove('active');
        const buttonText = button.querySelector('span').textContent;
        // A button is active only if it matches the exact option that was selected
        if (buttonText === option.name) {
            button.classList.add('active');
        }
    }
}

// Initialize tab cloak from localStorage
function initTabCloak() {
    const savedIcon = localStorage.getItem('tabCloakIcon');
    const savedTitle = localStorage.getItem('tabCloakTitle');
    const savedName = localStorage.getItem('tabCloakName');

    if (savedIcon && savedTitle) {
        // Find the exact option that matches all saved properties
        const savedOption = tabCloakOptions.find(opt => 
            opt.icon === savedIcon && 
            opt.title === savedTitle && 
            (!savedName || opt.name === savedName)
        );
        
        if (savedOption) {
            updateTabCloak(savedOption);
        }
    }
}

// Function to handle live custom tab cloak updates
function initCustomTabCloak() {
    const titleInput = document.getElementById('customTitle');
    const iconInput = document.getElementById('customIcon');
    const titlePreview = document.getElementById('titlePreview');
    const iconPreview = document.getElementById('iconPreview');
    const defaultIcon = '/app.png';

    // Check if elements exist before proceeding
    if (!titleInput || !iconInput || !titlePreview || !iconPreview) {
        console.log('Tab cloak elements not found, skipping initialization');
        return;
    }

    // Function to validate and update icon
    function updateIcon(url) {
        if (!url) {
            iconPreview.src = defaultIcon;
            updateTabCloak({ name: 'Custom', title: titleInput.value, icon: defaultIcon });
            return;
        }

        if (!url.startsWith('https://')) {
            iconPreview.src = defaultIcon;
            return;
        }

        // Test if image loads
        const testImg = new Image();
        testImg.onload = () => {
            iconPreview.src = url;
            updateTabCloak({ name: 'Custom', title: titleInput.value, icon: url });
        };
        testImg.onerror = () => {
            iconPreview.src = defaultIcon;
            updateTabCloak({ name: 'Custom', title: titleInput.value, icon: defaultIcon });
        };
        testImg.src = url;
    }

    // Update title in real-time
    titleInput.addEventListener('input', (e) => {
        const newTitle = e.target.value.trim() || 'Home | Hypackel';
        titlePreview.textContent = newTitle;
        updateTabCloak({
            name: 'Custom',
            title: newTitle,
            icon: iconPreview.src
        });
    });

    // Update icon with debounce
    let iconTimeout;
    iconInput.addEventListener('input', (e) => {
        clearTimeout(iconTimeout);
        iconTimeout = setTimeout(() => {
            updateIcon(e.target.value.trim());
        }, 500); // Wait 500ms after typing stops
    });

    // Initialize with default values
    titlePreview.textContent = 'Home | Hypackel';
    iconPreview.src = defaultIcon;
}

