// Tab system functionality
function initTabs() {
    const tabButtons = document.querySelectorAll('.tab-button');
    const tabContents = document.querySelectorAll('.tab-content');

    for (const button of tabButtons) {
        button.addEventListener('click', () => {
            // Remove active class from all buttons and contents
            for (const btn of tabButtons) {
                btn.classList.remove('active');
            }
            for (const content of tabContents) {
                content.classList.remove('active');
            }

            // Add active class to clicked button and corresponding content
            button.classList.add('active');
            const tabId = button.getAttribute('data-tab');
            document.getElementById(`${tabId}-tab`).classList.add('active');
        });
    }
}

// Function to apply custom tab cloak
function applyCustomTabCloak() {
    const customTitle = document.getElementById('customTitle').value.trim();
    const customIcon = document.getElementById('customIcon').value.trim();

    if (!customTitle) {
        alert('Please enter a page title');
        return;
    }

    if (customIcon && !customIcon.startsWith('https://')) {
        alert('Icon URL must start with https://');
        return;
    }

    // Update tab cloak with custom values
    updateTabCloak({
        name: 'Custom',
        title: customTitle,
        icon: customIcon || '/app.png' // Use default icon if none provided
    });
}

// Initialize tabs when page loads
document.addEventListener('DOMContentLoaded', () => {
    initTabs();
    createTabCloakButtons();
    initTabCloak();
    initCustomTabCloak();
});

